import React from 'react'
import ItomList from '../itom-list/itom-list'
import PersonDetales from '../person-detales/person-detales'
import SwapiService from '../../Services/swapi-service'

export default class PeoplePage extends React.Component {

 state = {
     personId:1
 }

swapi= new SwapiService();
changeId = (el)=>{
    this.setState({personId:el})
} 

render(){

return (

    <div className ="row mb2">
        <div className="col-md-6"> 
                <ItomList 
                 setParamList={this.swapi.getAllPeople}
                 usinItem={this.changeId}/> </div>
         <div className="col-md-6">
                 <PersonDetales
                 person={this.state.personId} 
                 getData={this.swapi.getPerson}/>
    </div></div>
    
);    
}}
